import React from "react";
export default class Tab extends React.Component(){
    constructor(props){
        super(props)
        this.state={
            use:[]
        }
    }
    componentDidMount(){
        let api1=fetch("https://jsonplaceholder.typicode.com/users")
        api1.then(x=>x.json()).then(val=>{
            this.setState({use:val})
        })
    }
    render(){
        console.log(this.state.use);
        
